import React, { useState } from "react";
import { Animate } from "react-move";

const Test = () =>{

    const [show,setShow] = useState(true);

    return(
        <div className="featured_wrapper">
            <Animate
                show={show}

            >
                {()=>(
                    <div>
                        Testing hello 123
                    </div>
                )}
            </Animate>
        </div>
    )
}

export default Test;
